  FOREIGN KEY JUST_PROYAGR_TIPO_FK (NUMIDTIPO) REFERENCES TB_UC3M_INV_JUST_TIPOS (NUMIDTIPO)
) COMMENT 'Tabla que contiene la relación de proyectos incluidos en una justificación en el marco de las ayudas del ministerio';
